You can terminate a C program in a few ways:

**1. Using the `exit()` function:**

   - This function immediately terminates the program and returns a status code to the operating system.

   ```c
   #include <stdio.h>
   #include <stdlib.h>

   int main() {
       printf("This program will terminate now.\n");
       exit(0); // Exit with a status code of 0 (success)
       return 0; // This line is not reached because exit() terminates the program
   }
   ```

**2. Using `return` statement in `main()` function:**

   - This is the standard way to end the `main()` function, which in turn terminates the program.

   ```c
   #include <stdio.h>

   int main() {
       printf("This program will terminate now.\n");
       return 0; // Return 0 to indicate successful execution
   }
   ```

**3. Using Ctrl+C (Interrupt signal):**

   - Pressing Ctrl+C while the program is running sends an interrupt signal to the program.

   - This might not always cleanly terminate the program, especially if it's in the middle of an operation.

**Important Notes:**

- The `exit()` function is generally preferred for explicit termination, as it allows you to specify a status code.
- Returning 0 from `main()` conventionally indicates successful execution, while non-zero values often signal an error.
- Always handle potential errors and exceptions in your program to ensure graceful termination.



